import React from 'react';
import ReactDOM from 'react-dom';

const TodoList = () => {

  const items = [ 'item1', 'item2' ];
  return (
    <ul>
      <li> { items[0] } </li>
      <li> { items[1] } </li>
    </ul>
  );
}

const AppHeader = () => {
  return (
    <h3>List of deals</h3>
  );
}

const SearchPanel = () => {
  return (
    <input placeholder = 'search' />
  );
}

const App = () => {
  return (
    <div>
      <AppHeader />
      <SearchPanel />
      <TodoList />
    </div>
  );
}

ReactDOM.render(<App />, document.getElementById('root'));
